import React from "react";

const Profile = () => {
  return (
    <>
      <div className="container mx-auto p-4 pt-6 md:p-6 lg:p-12 cursor-pointer">
        <div className="max-w-md mx-auto bg-white rounded-xl shadow-md overflow-hidden">
          <div className="p-5 text-center">
          
              <h2 className="text-lg font-semibold text-center mb-4 text-black underline">User Information</h2>
              <p className="text-sm text-slate-500">
                Username: <span className="font-semibold">johnDoe</span>
              </p>
              <p className="text-sm text-slate-500 mt-3">
                Email:{" "}
                <span className="font-semibold">johndoe@example.com</span>
              </p>
              <button className="bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded-lg mt-5 w-full">
                Logout
              </button>
       
          </div>
        </div>
      </div>
    </>
  );
};

export default Profile;
